INSERT INTO `events` (`id`, `event_date_en`, `event_date_bn`, `event_type_en`, `title_en`, `slug`, `title_bn`, `short_details_en`, `short_details_bn`, `description_en`, `description_bn`, `location_en`, `location_bn`, `gallery_link`, `seo_title`, `seo_meta`, `featured_images_en`, `featured_images_bn`, `alt_txt_en`, `alt_txt_bn`, `posted_by`, `updated_by`, `status`, `created_at`, `updated_at`) VALUES
(1, '১৭ ডিসেম্বর ২০২২', NULL, '1', 'ইপিএস পরিবারের ‘মহান বিজয় দিবস’ উদযাপন', 'ipies-pribarer-mhan-bijy-dibs-udzapn', NULL, '১৬ই ডিসেম্বর বাংলাদেশের ইতিহাসের সবচেয়ে গৌরবময় দিন। ১৯৭১ সালের ১৬ই ডিসেম্বর চূড়ান্ত বিজয় নিশ্চিত হবার পর থেকে আজ অবধি বাংলাদেশের সকল স্তরের মানুষ', NULL, '<p><strong><img id=\"Picture_x0020_1\" src=\"data:image/jpeg;base64,\" style=\"max-width:100%\" /></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>১৬ই ডিসেম্বর বাংলাদেশের ইতিহাসের সবচেয়ে গৌরবময় দিন। ১৯৭১ সালের ১৬ই ডিসেম্বর চূড়ান্ত বিজয় নিশ্চিত হবার পর থেকে আজ অবধি বাংলাদেশের সকল স্তরের মানুষ এই দিনটি মহাসমারোহে উদ্&zwnj;যাপন করে আসছে। ইপিএস পরিবারও মহান বিজয় দিবসের গাম্ভীর্যতা বজায় রেখে বর্ণিল আয়োজনে দিনটি অতিবাহিত করে।</p>\r\n\r\n<p>বিজয় দিবস উদ্&zwnj;যাপনের লক্ষ্যে ইপিএস পরিবার সজ্জিত হয় লাল-সবুজ রঙে, অফিস প্রাঙ্গণ যেন পরিণত হয় এক টুকরো বাংলাদেশে! এদিন সকালে উদ্&zwnj;যাপনের শুরু হয় ইজি পেমেন্ট সিস্টেম (ইপিএস) এর বোর্ড অব ডিরেক্টরদের মধ্যে পুস্পস্তবক বিনিময়ের মাধ্যমে। ইপিএস পরিবারের সকলেই একে অপরের সাথে কুশল বিনিময় করে এবং বিজয় দিবসের শুভেচ্ছা জানায়।</p>\r\n\r\n<p>মহান বিজয় দিবস উপলক্ষ্যে অনাড়ম্বর এক &lsquo;বিজয় আড্ডা&rsquo;র আয়োজন করা হয়। আড্ডায় সকলের সাথে ইজি পেমেন্ট সিস্টেম (ইপিএস) এর ব্যবস্থাপনা পরিচালক জনাব মো: শাহ আলম অংশগ্রহণ করেন। তিনি বিজয় দিবসের তাৎপর্য তুলে ধরার পাশাপাশি প্রতিটি মানুষের ব্যক্তিজীবনে সততা ও দেশপ্রেমের গুরুত্ব তুলে ধরেন।</p>\r\n\r\n<p>তবে ইপিএস পরিবারের বিজয় দিবস উদ্&zwnj;যাপনের মধ্যমনি হয়ে উপস্থিত ছিলেন বীর মুক্তিযোদ্ধা মো: দেলোয়ার হোসেন খান রাজিব (সাবেক যুগ্ন মহাসচিব, কেন্দ্রীয় কমান্ড কাউন্সিল, বাংলাদেশ মুক্তিযোদ্ধা সংসদ, ঢাকা)। জনাব রাজিব দীর্ঘদিন বাংলাদেশ ব্যাংক এর বিভিন্ন ডিপার্টমেন্টে সফলভাবে দায়িত্ব পালনের পর বর্তমানে জেনারেল ম্যানেজার হিসেবে ইজি পেমেন্ট সিস্টেম (ইপিএস) এ কর্মরত আছেন।</p>\r\n\r\n<p>তিনি ১৯৭১ সালে দেশপ্রেমে উদ্বুদ্ধ হয়ে নিজের প্রাণের মায়া ত্যাগ করে মুক্তিযুদ্ধে ঝাঁপিয়ে পড়েছিলেন এবং লড়াই করে দেশমাতৃকার বিজয় নিশ্চিত করেছেন। নয় মাসের সেই স্বাধীনতা সংগ্রামের সাথে জড়িয়ে আছে কতশত গল্প, তার কোনো ইয়ত্তা নেই। ইপিএস এর বিজয় আড্ডায় নতুন প্রজন্মের সামনে তিনি সেই গল্পের ঝুলিই যেন খুলে বসেছিলেন।</p>\r\n\r\n<p>এই বীর মুক্তিযোদ্ধার মুখে ১৯৭১ সালের সম্মুখ সমরের গল্প-কথা শুনে কেটে যায় দিনের দ্বিতীয় প্রহর। তিনি পুরো ইপিএস পরিবারকে মুক্তিযুদ্ধ এবং বিজয়ের অনুপ্রেরণায় অনুপ্রাণিত হয়ে কাজ করে যাওয়ার পরামর্শ দিয়ে তাঁর আলোচনা শেষ করেন। সবশেষে তাঁর জাদুকরী কন্ঠে দেশাত্মবোধক গানের সাথে গলা মিলিয়ে বিজয়ের মন্ত্রে উজ্জীবিত হয় ইপিএস পরিবার।</p>\r\n\r\n<p>&lsquo;আমরা বিজয়ী জাতি, আমরা জিতবই&rsquo; এই প্রেরণাকে সাথে নিয়েই ইপিএস এগিয়ে চলবে এবং বাংলাদেশের আগামী পথচলাকে সমৃদ্ধ করবে। এটাই আমাদের অঙ্গীকার।</p>\r\n\r\n<p><strong>১৬ই ডিসেম্বর, মহান বিজয় দিবসের বিজয়গাথা:</strong></p>\r\n\r\n<p>১৬ই ডিসেম্বর ১৯৭১, নয় মাসব্যাপী রক্তক্ষয়ী যুদ্ধে জয়ী হয়ে বিশ্ব মানচিত্রে আবির্ভূত হয় একটি নতুন দেশ। মাতৃভাষা &lsquo;বাংলা&rsquo;র নামে নামকরণ করা সেই ছোট্ট সবুজ ব-দ্বীপটিই আজকের বাংলাদেশ।</p>\r\n\r\n<p>বাংলাদেশকে এক রক্তাক্ত সংগ্রামের মধ্য দিয়ে যেতে হলেও আমরা পেয়েছি স্বাধীন সার্বভৌম একটি ভূখণ্ড। বিশ্ব ইতিহাসের পাতায় স্বর্ণাক্ষরে লেখা হয় আরও একটি বিজয়ের গল্প। ১৬ই ডিসেম্বর সারা বিশ্বের হৃদয়ে সসম্মানের সাথে স্থান করে নিয়েছিলো আরেকটি স্বাধীন দেশের নাম, সেটাই আমাদের প্রাণপ্রিয় বাংলাদেশ। এই স্বাধীনতার বিনিময়ে লাখো শহীদের রক্ত ঝড়েছে, খালি হয়েছে হাজারো মায়ের কোল। শত শত নারী হারিয়েছে তাদের সম্ভ্রম ও প্রিয়জন, আর হাজারো সন্তান তাদের বাবা-মাকে হারিয়ে হয়েছে নিঃস্ব।</p>\r\n\r\n<p>মহান বিজয় দিবসে গোটা জাতি শ্রদ্ধাভরে স্মরণ করে সেই সব বীরদের, যাঁদের সংগ্রাম, ত্যাগ ও রক্তে আমরা পেয়েছি লাল-সবুজের পতাকা। ইপিএস পরিবার জাতির সকল শ্রেষ্ঠ সন্তানদের জানায় বিনম্র শ্রদ্ধা।</p>\r\n\r\n<p>সবাইকে &lsquo;বিজয় দিবস&rsquo; এর শুভেচ্ছা।</p>', NULL, 'ইপিএস কর্পোরেট অফিস', NULL, NULL, 'seo title', 'meta', '7bdd9f888243903f74b41c5efc102933.jpg', 'b0069e90fe714ba4ff15b11d8ad7d7c0.jpg', 'ealt', 'bnalt', 1, 1, 1, '2022-12-27 12:02:58', '2022-12-27 12:05:01');

