INSERT INTO `faqs` (`id`, `ques_en`, `ques_bn`, `category`, `des_en`, `des_bn`, `status`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(1, 'What is EPS?', NULL, 1, '<p>EPS is a Payment System Operator (PSO) licensed by the Bangladesh Bank. EPS provides Digital Transaction solutions for end users. EPS is authorized to provide services for personal/individual usage and for business/merchant/organizational usage.</p>', NULL, 1, 1, NULL, '2022-12-28 04:57:50', '2022-12-28 07:17:18'),
(2, 'What are the EPS Services?', NULL, 1, '<p>EPS Services include</p>\r\n\r\n<ul style=\"list-style-type:square\">\r\n	<li>Payment Gateway</li>\r\n	<li>Bill Payment</li>\r\n	<li>Mobile Recharge</li>\r\n</ul>', NULL, 1, 1, 1, '2022-12-28 04:58:17', '2023-01-03 11:01:54'),
(12, 'How can I open an EPS account?', NULL, 2, '<p>If you are an individual who wants to use EPS for personal usage, download the EPS app (click here to download) and create your account using your phone number &amp; NID card. To open a Merchant Account need to few more documents. Please contact EPS Customer Support.</p>', NULL, 1, 1, 1, '2023-01-03 11:07:40', '2023-01-03 11:20:27'),
(13, 'What are the documents needed to open an EPS account?', NULL, 2, '<p>For a personal account your NID card and phone number are good enough to open an account. To open a Merchant Account need to few more documents. Please contact EPS Customer Support.</p>', NULL, 1, 1, 1, '2023-01-03 11:08:04', '2023-01-03 11:20:27'),
(14, 'Is EPS a free online transaction service?', NULL, 1, '<p>Depending on the Service type, EPS has a few services that are completely FREE to use. Other Services include Service Charges that are very affordable.</p>', NULL, 1, 1, 1, '2023-01-03 11:08:29', '2023-01-03 11:20:30'),
(15, 'Is my transaction safe over online?', NULL, 1, '<p>EPS uses Multiple Layers of Security to protect your data &amp; actions over the internet. EPS adapts the latest FinTech Technologies to make sure that you have a safe &amp; hassle-free environment for any online transaction.</p>', NULL, 1, 1, 1, '2023-01-03 11:09:40', '2023-01-03 11:20:31'),
(16, 'How do I contact EPS for any dispute/complaint?', NULL, 1, '<p>You can reach our customer support via phone, &amp; email.<br />\r\nContact Number: 09614-770066<br />\r\nE-mail: support@eps.com.bd</p>', NULL, 1, 1, 1, '2023-01-03 11:10:41', '2023-01-03 11:20:33'),
(17, 'When someone pays me through EPS, how do I get the money?', NULL, 1, '<p>Money can be received both in Bank A/C and MFS Wallet.</p>', NULL, 1, 1, 1, '2023-01-03 11:11:08', '2023-01-03 11:20:34'),
(18, 'When someone sends me money on EPS, does it go to my bank account?', NULL, 1, '<p>Yes. It is instantly transferred to your bank A/C via EPS network.</p>', NULL, 1, 1, 1, '2023-01-03 11:11:34', '2023-01-03 11:20:36'),
(19, 'How can I download the EPS App?', NULL, 1, '<p>You can get it from the play store (Android), App Store (iOS) or via direct repository from EPS website.</p>', NULL, 1, 1, 1, '2023-01-03 11:11:59', '2023-01-03 11:20:38'),
(20, 'How can I recover my EPS account password?', NULL, 1, '<p>You can reset your PIN using the EPS app or via contacting EPS support.</p>', NULL, 1, 1, 1, '2023-01-03 11:12:33', '2023-01-03 11:20:41'),
(21, 'Do I need to open an account to use EPS services?', NULL, 1, '<p>Yes! To access all EPS services, users have to open an EPS account.</p>', NULL, 1, 1, 1, '2023-01-03 11:13:11', '2023-01-03 11:20:57'),
(22, 'Who can open an account for EPS?', NULL, 1, '<ul>\r\n	<li>End Users: (General User, Any Bangladeshi National who has a valid NID).</li>\r\n	<li>Businesses: (Any registered and valid Business that is authorized by the Government of Bangladesh to operate as a business entity in Bangladesh).</li>\r\n</ul>', NULL, 1, 1, 1, '2023-01-03 11:13:44', '2023-01-03 11:21:03'),
(23, 'Where shall I go to open an EPS account?', NULL, 2, '<p>You can open an account using the EPS mobile app or EPS web application (Merchant).</p>', NULL, 1, 1, 1, '2023-01-03 11:14:17', '2023-01-03 11:21:06'),
(24, 'Can I make transactions 24/7 using EPS?', NULL, 3, '<p>Yes.</p>', NULL, 1, 1, 1, '2023-01-03 11:14:34', '2023-01-03 11:21:10'),
(25, 'Is there any charge to opening an EPS account?', NULL, 2, '<p>No.</p>', NULL, 1, 1, 1, '2023-01-03 11:14:57', '2023-01-03 11:21:13'),
(26, 'How shall I be notified after each transaction?', NULL, 3, '<p>Via EPS app notification &amp; SMS</p>', NULL, 1, 1, 1, '2023-01-03 11:15:21', '2023-01-03 11:21:16'),
(27, 'What happens If I enter the wrong PIN multiple times?', NULL, 2, '<p>Your EPS account will be locked temporarily &amp; you&#39;ll have to contact support to reset your PIN &amp; activate your EPS account.</p>', NULL, 1, 1, 1, '2023-01-03 11:15:46', '2023-01-03 11:21:19'),
(28, 'What will be the process if the transaction ID is required but confirmation SMS is unavailable?', NULL, 3, '<p>You can check your app history or reach our customer support.</p>', NULL, 1, 1, 1, '2023-01-03 11:16:08', '2023-01-03 11:21:22'),
(29, 'How long does it take to complete a transaction?', NULL, 3, '<p>EPS transactions are Instantaneous. Based on EPS partner system policy and availability, a transaction may takes more time.</p>', NULL, 1, 1, 1, '2023-01-03 11:16:30', '2023-01-03 11:21:25'),
(30, 'How do I keep my account secure?', NULL, 2, '<p>DO NOT share your EPS PIN with anyone. EPS support staff will never ask for your PIN under any circumstances.</p>', NULL, 1, 1, 1, '2023-01-03 11:16:53', '2023-01-03 11:21:32'),
(31, 'What happens to my EPS account if I change my mobile number or account?', NULL, 2, '<p>You can re-login to your EPS account using the EPS app.</p>', NULL, 1, 1, 1, '2023-01-03 11:17:13', '2023-01-03 11:21:36'),
(32, 'Is there any charge If I call EPS helpline number?', NULL, 1, '<p>Standard call charges will be applied by your mobile operator.</p>', NULL, 1, 1, 1, '2023-01-03 11:17:38', '2023-01-03 11:21:38'),
(33, 'How will EPS charge me for each transaction?', NULL, 3, '<p>EPS service charges will be shown to the user before final confirmation (If any charges are applicable for the service).</p>', NULL, 1, 1, 1, '2023-01-03 11:18:04', '2023-01-03 11:21:41'),
(34, 'How do I delete my EPS account?', NULL, 2, '<p>Please Contact EPS Customer Support to block/disable or delete your account.</p>', NULL, 1, 1, 1, '2023-01-03 11:18:21', '2023-01-03 11:21:44'),
(35, 'What shall I do if my mobile is lost or stolen?', NULL, 2, '<p>In that event, contact EPS support immediately to lock &amp; reset your EPS account.</p>', NULL, 1, 1, 1, '2023-01-03 11:18:43', '2023-01-03 11:21:47'),
(36, 'Can I have more than one EPS account?', NULL, 2, '<p>We strongly suggest you NOT to open multiple EPS accounts using a single NID cause this may result in a permanent suspension of all your accounts for fraudulent activity.</p>', NULL, 1, 1, 1, '2023-01-03 11:19:10', '2023-01-03 11:21:51'),
(37, 'Can I get any account transaction statements?', NULL, 3, '<p>Yes, you can access &amp; download the transaction statement from your mobile app.</p>', NULL, 1, 1, 1, '2023-01-03 11:19:28', '2023-01-03 11:21:53'),
(38, 'Are there any hidden charges?', NULL, 1, '<p>All service charges are disclosed to the user before transaction event. EPS does not have any hidden charges.</p>', NULL, 1, 1, 1, '2023-01-03 11:19:53', '2023-01-03 11:21:56'),
(39, 'Is there any charge for accessing EPS through USSD?', NULL, 1, '<p>Currently, EPS services are not available through USSD</p>', NULL, 1, 1, 1, '2023-01-03 11:20:14', '2023-01-03 11:21:59');

