(3, 'What you need to know about SWIFT', NULL, 'What-you-need-to-know-about-SWIFT', 2, 'In 2021, banks and other financial institutions used SWIFT to conduct 4.2 million financial transactions per day throughout the', NULL, '<p><img alt=\"\" src=\"https://eps.com.bd/frontend/img/blog/swift.png\" style=\"max-width:100%\" /></p>\r\n\r\n<div class=\"blogtext\" style=\"-webkit-text-stroke-width:0px; box-sizing:border-box; color:#212529; flex-shrink:0; font-family:poppins,sans-serif; font-size:16px; font-style:normal; font-variant-caps:normal; font-variant-ligatures:normal; font-weight:400; letter-spacing:normal; margin-top:20px; max-width:100%; orphans:2; padding-left:calc(var(--bs-gutter-x) * 0.5); padding-right:calc(var(--bs-gutter-x) * 0.5); text-align:start; text-decoration-color:initial; text-decoration-style:initial; text-decoration-thickness:initial; text-indent:0px; text-transform:none; white-space:normal; widows:2; width:790.987px; word-spacing:0px\">\r\n<p style=\"text-align:justify\">In 2021, banks and other financial institutions used SWIFT to conduct 4.2 million financial transactions per day throughout the world. In comparison to daily transactions in 2020, the transaction rate is 11.4% greater now. This sort of information was just added to the official website of SWIFT, a company that provides financial messaging services or financial data transactions.</p>\r\n\r\n<p style=\"text-align:justify\">SWIFT added on its website that the highest-ever message traffic (message through communication system) was recorded on November 30, 2021. It was about 5.3 million numbers of messages that occurred on that day. This message traffic record crossed the previously highest record by 8.5% on a single day.</p>\r\n\r\n<p style=\"text-align:justify\">The average amount of financial messages through using the SWIFT channel was 4.6 million in the year 2022. SWIFT keeps updating its website data regarding its financial message traffic on a regular basis. (www.swift.com)</p>\r\n\r\n<p style=\"text-align:justify\">By going through the surprising data, it is clear that &lsquo;SWIFT&rsquo; is one of the most significant ones which has to be studied properly in order to get a clear understanding of the financial sectors from an international perspective.</p>\r\n\r\n<p style=\"text-align:justify\">Let&rsquo;s get to know some important data about SWIFT, a financial messaging platform that is also known as the &ldquo;atomic bomb&rsquo;&rsquo; of the financial sector.</p>\r\n\r\n<h3>What is SWIFT?</h3>\r\n\r\n<p style=\"text-align:justify\">The full form of SWIFT is&nbsp;Society for Worldwide Interbank Financial Telecommunication,&nbsp;which is basically a global financial messaging platform. The most important aim of developing SWIFT is to create a faster network between banks and financial institutions worldwide and deliver financial messages and information from one network to another instantly.</p>\r\n\r\n<p style=\"text-align:justify\">This SWIFT is also known as&nbsp;Worldwide Interbank Financial Telecommunication.</p>\r\n\r\n<h3>SWIFT: When, Where, and How</h3>\r\n\r\n<p style=\"text-align:justify\">SWIFT started its journey in 239 banks from 15 different countries in 1973. Its headquarter is situated in&nbsp;La Hulpe, Belgium.&nbsp;SWIFT started providing SWIFT financial messaging services instead of telex technology in 1977 although its initial phase started in 1973. Usually, creating a more reliable and secure messaging service was the main aim of working behind the leading objective.</p>\r\n\r\n<p style=\"text-align:justify\">518 financial institutions from 22 countries got connected with the SWIFT messaging service in 1977. In the later years, this messaging service has been globally defined as an important segment of the financial sector.</p>\r\n\r\n<p style=\"text-align:justify\">At present, SWIFT has been working for more than 200 countries of the world where it is connected with more than 11 thousand financial institutions. Currently, SWIFT has 26 offices worldwide.</p>\r\n\r\n<h3>Who Controls SWIFT</h3>\r\n\r\n<p style=\"text-align:justify\">Basically, the United States and European banks founded this Belgian-based institution. SWIFT is a partnership network corporation that has roughly 2000 banks and other financial institutions as stockholders.</p>\r\n\r\n<p style=\"text-align:justify\">These shareholders elect a board of 25 independent directors, representing banks around the world. They basically manage Swift and oversee the management of the company. A team of full-time employees led by the CEO serves as the executive committee.</p>\r\n\r\n<p style=\"text-align:justify\">All major G-10 central banks, including the Federal Reserve Bank of the United States and the Bank of England, oversee Swift&#39;s operations. In addition, the National Bank of Belgium oversees Swift&#39;s operations (G-10 Central Banks are as follows- Belgium, Canada, France, Germany, Italy, Japan, Netherlands, United Kingdom, United States, Switzerland, and Sweden).</p>\r\n\r\n<h3>How SWIFT is operated?</h3>\r\n\r\n<p style=\"text-align:justify\">As it is not a payment system, no money can be transacted directly through SWIFT. However, trillions of dollars of transaction information are exchanged using SWIFT every year. SWIFT is basically a messaging platform, whose main function is to instantly inform users about any transaction that occurred.</p>\r\n\r\n<p style=\"text-align:justify\">Banks use the SWIFT channel to pay merchants for cross-border transactions. Not only traders but also the governments of different countries have started transacting through the SWIFT network. In this case, the transactions are done through the central banks or commercial banks of the countries.</p>\r\n\r\n<h3>The is SWIFT Code?</h3>\r\n\r\n<p style=\"text-align:justify\">The Swift Code is a special code approved by the Swift Platform that identifies a specific organization name, country name, city name, and branch name. Swift code is required only when a person or organization wants to send money to a foreign account.</p>\r\n\r\n<p style=\"text-align:justify\">A unique code of 8 or 11 characters is assigned to each organization in the Swift Network. This is called the Business Identifier Code (BIC). This BIC code is the Swift code we were discussing above.</p>\r\n\r\n<p style=\"text-align:justify\">This code has received recognition by the following three names:<br />\r\n1. The Business/Bank Identifier Code (BIC)<br />\r\n2. SWIFT Code<br />\r\n3. SWIFT ID or ISO 9362 Code</p>\r\n\r\n<p style=\"text-align:justify\">By whatever name this SWIFT code or SWIFT ID or ISO 9362 got its recognition, this BIC is a standard format of those Business Identifier Codes approved by the International Organization for Standardization (ISO). Such unique codes are used to facilitate the automatic processing of information of all financial and non-financial institutions.</p>\r\n\r\n<p style=\"text-align:justify\">There are two types of BIC codes for SWIFT networks. One is the Connected BIC Codes Connected BICs) with which SWIFT is connected. The other is non-connected BIC codes (Non-connected BICs) with which SWIFT is not connected, it is used for reference only.</p>\r\n\r\n<p style=\"text-align:justify\">Now the major point of discussion is what do 8 characters and 11 characters of codes actually indicate?</p>\r\n\r\n<h3>What are the elements found in a code which consists of 8 characters?</h3>\r\n\r\n<p style=\"text-align:justify\">The first 4 characters of the 8-character Swift code can be used to identify the initial name of the bank or business organization, the next 2 to identify the country, and the last 2 to identify the city.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Example:</strong><br />\r\nThe SWIFT Code of Islami Bank Bangladesh Limited- IBBLBDDH.<br />\r\nHere, the first four characters imply the bank code- IBBL= Islami Bank Bangladesh Limited<br />\r\nThe next two characters signify the country code- BD= Bangladesh<br />\r\nFinally, the last two characters imply the city code- DH= Dhaka</p>\r\n\r\n<h3>What do you mean by a SWIFT code that consists of 11 characters?</h3>\r\n\r\n<p style=\"text-align:justify\">The first 8 of the 11-character Swift code identify the bank&#39;s initial name, country, and city in the same way. The next 3 characters or numbers can be used to identify a particular branch of a bank or organization. However, 3 characters are optional. Transactions can be done without them too.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>Example:</strong><br />\r\nThe SWIFT Code of Islami Bank Bangladesh Limited&#39;s Barisal Branch- IBBLBDDH111. Here-<br />\r\nThe first four characters imply the bank code- IBBL= Islami Bank Bangladesh Limited<br />\r\nThe next two characters signify the country code- BD= Bangladesh<br />\r\nThe latter two characters imply the city code- DH= Dhaka<br />\r\nAnd finally, the last three characters signify the branch identifier code- 111= Barisal Branch</p>\r\n\r\n<h3>How can we transact via a SWIFT code?</h3>\r\n\r\n<p style=\"text-align:justify\">Let&#39;s say you want to transfer money from your City bank account to a buddy who lives in the US and has a Bank of America account at a particular location. To conduct the transactions with that friend financially, all you have to do is-<br />\r\n1. Your friend&#39;s Bank of America account number<br />\r\n2. Your friend&rsquo;s name<br />\r\n3. SWIFT code of the specific branch of the bank</p>\r\n\r\n<p style=\"text-align:justify\">Once City Bank has been given proper information, City Bank will use the SWIFT Network to issue a request for a money transfer to that specific Bank of America branch. The money is credited to your friend&#39;s account after being validated and cleared that are received by Bank of America from that specific branch.</p>\r\n\r\n<h3>Is it possible to transact overseas without using SWIFT Code?</h3>\r\n\r\n<p style=\"text-align:justify\">A bank that has a SWIFT code works with institutions that don&#39;t have one to conduct financial transactions. This third bank serves as a bridge for financial transactions. Bangladesh, like the majority of other countries and financial institutions, is linked to the Swift network.</p>\r\n\r\n<p style=\"text-align:justify\">Overseas transactions can also be done with an IBAN code instead of the SWIFT code. The full form of IBAN is- International Bank Account Number (IBAN). IBAN code is another standard format of business identifier code, similar to the SWIFT code or BIC code, which is approved by the International Organization for Standardization (ISO).</p>\r\n</div>', NULL, 'e06c3e806e9630470e7b4cc3f243d699.png', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2023-01-01 04:23:38', '2023-01-01 07:33:02');
INSERT INTO `posts` (`id`, `title_en`, `title_bn`, `slug`, `category`, `shortdes_en`, `shortdes_bn`, `description_en`, `description_bn`, `images_en`, `images_bn`, `seo_title`, `seo_meta`, `alt_en`, `alt_bn`, `status`, `editable`, `posted_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(4, 'Real-Time fund transfer using RTGS', NULL, 'real-time-fund-transfer-using-rtgs', 2, 'RTGS or BD-RTGS stands for Real-time Gross Settlement in its full form. What is RTGS? The simplest explanation is that it is an electronic fund', NULL, '<p style=\"text-align:justify\"><img alt=\"\" src=\"data:image/png;base64,\" style=\"max-width:100%\" /></p>\r\n\r\n<p style=\"text-align:justify\">RTGS or BD-RTGS stands for Real-time Gross Settlement in its full form. What is RTGS? The simplest explanation is that it is an electronic fund settlement system that allows users to move funds from their own accounts to any other bank account holder or transfer funds seamlessly.</p>\r\n\r\n<p style=\"text-align:justify\">The Bangladesh Bank launched the RTGS to the local payment ecosystems on December 19, 2015. Since then, RTGS has been able to open a new door to the country&#39;s banking sector and has been acknowledged as a safe and fast payment method.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">RTGS Service Platforms:</h3>\r\n\r\n<p style=\"text-align:justify\">The Real-Time Gross Settlement -RTGS system is an interbank payment system. It still operates within the parameters of the local region and uses local currencies. However, international currencies will be added to this payment method very soon.</p>\r\n\r\n<p style=\"text-align:justify\">This payment procedure now connects more than 10,888 virtual branches from around 59 banking institutions.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Advantages of RTGS fund transfer:</h3>\r\n\r\n<ul style=\"margin-left:0; margin-right:0\">\r\n	<li>The RTGS procedure might take a ranging from a few minutes to 30 minutes to complete. Users from one bank can effortlessly send large sums of money to anyone else&#39;s bank account, as well as receive remittances.</li>\r\n	<li>RTGS may transfer any sum over one lakh in monetary money, however, it has no restrictions when it comes to government transactions.</li>\r\n	<li>Aside from local transactions, customers can utilize the RTGS payment system to move international funds inside the area.</li>\r\n	<li>The services that are available from the RTGS payment process are- &middot; Online VAT payment, customer duty payment, Automated Consignment System (ACS), and other services are available. All additional delayed Net Settlement Batch (DNSB) transactions, such as BACPS, BEFTN, or NPSB, can be settled via the RTGS system in addition to these interbank transaction services. Not only that but the BD-RTGS system integrated into Bangladesh Bank&#39;s core banking solution.</li>\r\n	<li>The sole disadvantage of the RTGS transaction method is that customers are not permitted to send funds less than one lakh taka.</li>\r\n</ul>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">RTGS vs BEFTN:</h3>\r\n\r\n<p style=\"text-align:justify\">BEFTN may take one or two working days to execute a transaction, but the RTGS fund transfer system allows for real-time or immediate transfers.</p>\r\n\r\n<p style=\"text-align:justify\">BEFTN usually has no restriction on the amounts of transactions you can do, however, the RTGS payment method has a limit of minimum one lac per transaction.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">How to conduct the RTGS?</h3>\r\n\r\n<p style=\"text-align:justify\">Through RTGS, a customer can make various types of transactions online or in person. A customer can go to the bank and do RTGS with the help of bank employees. However, in this age of FinTech, a customer will be able to perform RTGS from his smartphone at home. For this, the customer&#39;s phone only needs to have his bank&#39;s mobile app.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Information needed to operate RTGS:</h3>\r\n\r\n<ul style=\"margin-left:0; margin-right:0\">\r\n	<li>The exact bank account name and number of the recipient.</li>\r\n	<li>Recipient bank name, branch name, and bank routing number.</li>\r\n	<li>Recipient&#39;s mobile number.</li>\r\n	<li>Customer or sender&#39;s own name, address, voter ID card number, and mobile number.</li>\r\n	<li>The purpose of the money transaction must be written.</li>\r\n	<li>Lastly, the customer has to sign a letter of consent stating that he/she is not doing any kind of money laundering through this transaction.</li>\r\n</ul>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Current Status of BD-RTGS Transactions in Bangladesh:</h3>\r\n\r\n<p style=\"text-align:justify\">The total number of RTGS transactions between July and September 2021 was 11,54,98, with a financial value of Rs 5,61,843 crore. In the fiscal year 2019-2020, 1.92 million transactions of Rs. 12,220 billion were conducted using the Real Time Gross Settlement (RTGS) system. (Source: Bangladesh Bank)</p>\r\n\r\n<p style=\"text-align:justify\">Among all the initiatives by Bangladesh government, the Real-Time Gross Settlement (RTGS) system is one of the most significant ones in order to encourage the cashless payment system.</p>', NULL, '6bf5841ee9cae19f42d1ca1f76231527.png', '', NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2023-01-01 04:36:55', '2023-01-01 07:33:04');
INSERT INTO `posts` (`id`, `title_en`, `title_bn`, `slug`, `category`, `shortdes_en`, `shortdes_bn`, `description_en`, `description_bn`, `images_en`, `images_bn`, `seo_title`, `seo_meta`, `alt_en`, `alt_bn`, `status`, `editable`, `posted_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(5, 'NPSB: National Payment Switch Bangladesh', NULL, 'npsb-national-payment-switch-bangladesh', 2, 'The National Payment Switch Bangladesh (NPSB) is an electronic platform for financial transactions. In terms of card-based and internet-based', NULL, '<p style=\"text-align:justify\"><img alt=\"\" src=\"data:image/png;base64,\" style=\"max-width:100%\" /></p>\r\n\r\n<p style=\"text-align:justify\">The National Payment Switch Bangladesh (NPSB) is an electronic platform for financial transactions. In terms of card-based and internet-based financial transactions, it links Bangladesh&#39;s banks with one another. NPSB&#39;s major goal is to provide interbank services, which entails the exchange of services between two banks. Since December 26, 2012, Bangladesh Bank has begun working on the service.</p>\r\n\r\n<p style=\"text-align:justify\">What is NPSB? To get the answer to this question, you need to know about 3 means of transaction through NPSB- ATM, POS and IBFT.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Area and types of service:</h3>\r\n\r\n<p style=\"text-align:justify\">The National Payment Switch Bangladesh (NPSB) is currently working with three interbank transaction mediums. However, attempts are underway to put mobile financial services (MFS) providers under this service in near future.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">1. Automated Teller Machine (ATM):</h3>\r\n\r\n<p style=\"text-align:justify\">The Automated Teller Machine or ATM, is a machine that allows a bank customer to withdraw cash from his own bank account using a card. The ATM booths under NPSB are interoperable. As a consequence, users of one bank may use their cards to withdraw cash, transfer funds, check balances and print mini statements from ATMs of other banks as well as their own bank&#39;s ATM booths.</p>\r\n\r\n<p style=\"text-align:justify\">As of May 2022, a total of 54 banks in the country are interconnected through NPSB and naturally their ATM booths are inter-operable.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">ATM Transaction limit:</h3>\r\n\r\n<p style=\"text-align:justify\"><strong>Withdrawal Limit:</strong>&nbsp;The cash withdrawal limit of ATM machines in Bangladesh is Tk 20,000 to Tk 40,000 per single transaction, depending on the bank. The daily ATM withdrawal limit is Tk 150,000 to Tk 200,000 per 24-hour cycle, again depending on the bank and whether your card type is Silver, Gold, Platinum, Signature, Infinity, etc.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>ATM Transaction Charge:</strong>&nbsp;Customers must pay 15 tk for cash withdrawals from another bank&#39;s ATM and 5 tk for a mini statement. Getting these services via your bank&#39;s ATM, on the other hand, is free.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">2. Point of Sales (POS):</h3>\r\n\r\n<p style=\"text-align:justify\">A bank customer can pay for a product or service using a card at a point of sale (POS) system. In this instance, the POS of the banks that are member of the NPSB are likewise interoperable. As a consequence, a bank client can use the POS of another bank in addition to his own bank&#39;s POS to pay for any goods or services at numerous merchant outlets. A total of 53 banks are offering interoperable POS transaction services as of October 2021.</p>\r\n\r\n<p style=\"text-align:justify\"><strong>POS Transaction Charge:</strong>&nbsp;For POS transactions, bank cardholders are not charged separately.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">3. Internet Banking Fund Transfer (IBFT):</h3>\r\n\r\n<p style=\"text-align:justify\">A consumer can use the IBFT service to transfer money from one bank account or card to another via online banking. IBFT services are provided by a total of 30 inter-operable banks as of October 2021. Customers can use IBFT to pay utility bills, credit card bills, loan installment payments, insurance premium payments and other items via internet banking at home or at the bank.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Transaction Limit for IBFT:</h3>\r\n\r\n<p style=\"text-align:justify\">IBFT transactions have distinct limits for individual and institutional trades.</p>\r\n\r\n<ul style=\"margin-left:0; margin-right:0\">\r\n	<li>Personal transactions have a maximum limit of tk 3 lakhs per transaction, a maximum of 10 transactions per day and a maximum transaction value of tk 10 lakhs.</li>\r\n	<li>Institutional or corporate clients have a maximum limit of tk 5 lakhs per transaction, a maximum of 20 transactions per day and a maximum transaction value of tk 25 lakhs.</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\">Inter-operative banks must ensure two-factor authentication (2FA) for every online / e-commerce / inter-banking / card transaction in the event of IBFT transactions.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Special benefits:</h3>\r\n\r\n<p style=\"text-align:justify\">Inter-operative banks are connected to each other through NPSB so that customers of a particular bank can avail themselves of services with another bank using ATM, POS, and IBFT. This saves customer&rsquo;s valuable time.</p>\r\n\r\n<p style=\"text-align:justify\">Overall, NPSB has reduced the risk of carrying cash and checkbooks. It is also relieving customers from the hassle of standing in line.</p>', NULL, 'e7e567bc4bd376b60f90744d4fa07da9.png', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2023-01-01 04:38:55', '2023-01-01 07:33:06');
INSERT INTO `posts` (`id`, `title_en`, `title_bn`, `slug`, `category`, `shortdes_en`, `shortdes_bn`, `description_en`, `description_bn`, `images_en`, `images_bn`, `seo_title`, `seo_meta`, `alt_en`, `alt_bn`, `status`, `editable`, `posted_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(6, 'BEFTN: Bangladesh Electronic Funds Transfer Network', NULL, 'beftn-bangladesh-electronic-funds-transfer-network', 3, 'BEFTN stands for Bangladesh Electronic Funds Transfer Network, however, it is now simply known as Electronic Funds Transfer or EFT in', NULL, '<p style=\"text-align:justify\"><img alt=\"\" src=\"data:image/png;base64,\" style=\"max-width:100%\" /></p>\r\n\r\n<p style=\"text-align:justify\">BEFTN stands for Bangladesh Electronic Funds Transfer Network, however, it is now simply known as Electronic Funds Transfer or EFT in the workplace. A consumer can use BEFTN to conduct financial transactions with another bank&#39;s customer from his bank account.</p>\r\n\r\n<p style=\"text-align:justify\">To make the paper-based financial transaction system more safe and dynamic, the introduction of paperless fund transfer technology is the key.</p>\r\n\r\n<p style=\"text-align:justify\">On February 26, 2011, Bangladesh Bank began operations in BEFTN. This technology is currently accessible in the majority of the country&#39;s public and commercial banks.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">BEFTN&rsquo;s Area of Services:</h3>\r\n\r\n<ul style=\"margin-left:0; margin-right:0\">\r\n	<li>Any sort of credit transfer, such as international or domestic remittance, interest and principal of savings certificates, retirement benefits, monthly salary-allowance, dividend, interest, and so on can be done by using EFT credit.</li>\r\n	<li>In addition, EFT debit can be used to recover utility costs such as electricity, water and gas bills, loan installments and insurance premiums from a customer&#39;s bank account.</li>\r\n	<li>The electronic fund transfer option is now available twice a day in the latest update of BACH. During bank holidays, this service will not be offered in banks or online.</li>\r\n	<li>BEFTN Fee: There is currently no fee for using BEFTN to transfer funds.</li>\r\n	<li>Transferring money via BEFTN takes only one working day. Money can now be moved instantly if you can transact before 10 a.m.</li>\r\n</ul>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">How to use BEFTN:</h3>\r\n\r\n<p style=\"text-align:justify\">Customers may use BEFTN to conduct a variety of transactions online or in person. Customers can go to the bank and complete BEFTN with the assistance of bank employees. However, in the age of Fintech, a consumer may do BEFTN from his own home using his smartphone. The customer&#39;s phone merely has to have his bank&#39;s mobile app for this to work.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Information required for BEFTN transaction:</h3>\r\n\r\n<p style=\"text-align:justify\">1. The exact bank account name and number of the recipient.<br />\r\n2. Recipient bank name, branch name and bank routing number.<br />\r\n3. Recipient&#39;s mobile number.<br />\r\n4. Customer or sender&#39;s own name, address, voter ID card number and mobile number.<br />\r\n5. The purpose of the money transaction must be written.<br />\r\n6. Lastly, the customer has to sign a letter of consent stating that he is not doing any kind of money laundering through this transaction.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">BEFTN&#39;s current status:</h3>\r\n\r\n<p style=\"text-align:justify\">You&#39;ll be amazed to learn that in the financial year 2019-2020, a total of 50.44 million credit transactions worth 2458.54 billion taka were made in the country through BEFTN! And a total of 3.83 million debit transactions were made that were worth 229.60 billion taka. This pace of transactions is a good indicator of BEFTN&#39;s popularity.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Where to report any transaction issues:</h3>\r\n\r\n<p style=\"text-align:justify\">If a client has a problem with a BEFTN transaction, he or she should first contact his or her bank branch. If the problem is not fixed, the complaint should be forwarded to Bangladesh Bank&#39;s General Manager&#39;s e-mail address (gm.psd@bb.org.bb).</p>', NULL, '072c503fc4ab3cca6490f5c885ae3079.png', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2023-01-01 04:41:51', '2023-01-01 07:33:08');
INSERT INTO `posts` (`id`, `title_en`, `title_bn`, `slug`, `category`, `shortdes_en`, `shortdes_bn`, `description_en`, `description_bn`, `images_en`, `images_bn`, `seo_title`, `seo_meta`, `alt_en`, `alt_bn`, `status`, `editable`, `posted_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(7, 'IDTP: First Step Towards a cashless society', NULL, 'idtp-first-step-towards-a-cashless-society', 2, 'The Interoperable Digital Transaction Platform (IDTP) is an initiative of the Bangladesh government; whose primary objective is', NULL, '<p style=\"text-align:justify\"><img src=\"https://eps.com.bd/frontend/img/blog/idtp.png\" style=\"max-width:100%\" /></p>\r\n\r\n<p style=\"text-align:justify\">The Interoperable Digital Transaction Platform (IDTP) is an initiative of the Bangladesh government; whose primary objective is to bring the general people online to deliver digital financial services connected to financial transactions.</p>\r\n\r\n<p style=\"text-align:justify\">It will serve as a bridge between a variety of financial service providers, including banks, non-banking financial institutions, merchants and enterprises, and usual clients. Bangladesh Bank will manage the IDTP platform.</p>\r\n\r\n<p style=\"text-align:justify\">&quot;IDTP will allow real-time and low-cost transfer of funds in the financial sector,&quot; stated State Minister for ICT, Junaid Ahmed Palak.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Area and type of service:</h3>\r\n\r\n<ul style=\"margin-left:0; margin-right:0\">\r\n	<li>The Interoperable Digital Transaction Platform (IDTP) will be a service whose application programming interface (API) will be used by the country&#39;s Fintech companies and will enable digital money transactions, e-commerce, m-commerce, bill payments, merchant payments, exchange of remittances, machine-to-machine payments and other transactions are possible through it.</li>\r\n	<li>Simply, the inter-operative digital transaction platform is a new means to move money from one mobile financial service (MFS) to another MFS, as well as from MFS to banks and other payment service providers (PSPs). This implies that all financial service providers will be grouped together.</li>\r\n	<li>For example, a bKash user will be able to effortlessly transfer money to a Nagad user; once the IDTP platform is enabled.</li>\r\n	<li>IDTP registered clients can scan the QR code (Quick Response Code) to pay for goods in any store or shop, in addition to digital transactions. By the implementation of IDTP clients will be able to conduct financial transactions with more convenience. Because, each transaction will be protected by Two Factor Authentication (2FA).</li>\r\n	<li>Money transaction through NID card- Because all of a customer&#39;s transactions will be done through his or her National Identity Card Number (NID), the number of issues such as money laundering, financial fraud, and illegal funding should be reduced.</li>\r\n</ul>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Implementation of IDTP:</h3>\r\n\r\n<p style=\"text-align:justify\">In the conference room of the Information and Communication Technology Department at ICT Tower, Agargaon, a Memorandum of Understanding (MoU) was signed in 2019 between the Information and Communication Technology Department and Bangladesh Bank for the implementation of the Inter-Operative Digital Transaction Platform (IDTP). The goal of the effort is to boost fintech and digital financial inclusion.</p>\r\n\r\n<p style=\"text-align:justify\">On behalf of the Information and Communication Technology Department, Syed Mojibul Haque, Director (Additional Secretary), Idea Project; and on behalf of Bangladesh Bank, Mesbaul Haque, General Manager, Payment Systems Department, signed the MoU.</p>\r\n\r\n<p style=\"text-align:justify\">&quot;Interoperability would have a good influence on the financial industry and will enable financial services providers to understand the nature of clients by evaluating data on interbank MFS transactions,&quot; said Atiur Rahman, former central bank governor.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Cashless economy:</h3>\r\n\r\n<p style=\"text-align:justify\">In Bangladesh, IDTP technology will play a crucial role in the development of a cashless society. One of the most essential components is the Inter-Operative Digital Transaction Platform (IDTP) to achieve the goal of the Bangladesh Government&rsquo;s &lsquo;Digital Bangladesh&rsquo;.</p>', NULL, '80cbe29a6fd508a7ab3dbd5730616953.png', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2023-01-01 04:46:01', '2023-01-01 07:33:10');
INSERT INTO `posts` (`id`, `title_en`, `title_bn`, `slug`, `category`, `shortdes_en`, `shortdes_bn`, `description_en`, `description_bn`, `images_en`, `images_bn`, `seo_title`, `seo_meta`, `alt_en`, `alt_bn`, `status`, `editable`, `posted_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(8, 'Post-liberation Economic Status of Bangladesh', NULL, 'post-liberation-economic-status-of-bangladesh', 4, 'After a violent 9-month liberation battle and the sacrifices of more than 3 million Bangladeshi patriots, the country has gained freedom and independence.', NULL, '<p style=\"text-align:justify\"><img alt=\"\" src=\"data:image/png;base64,\" style=\"max-width:100%\" /></p>\r\n\r\n<p style=\"text-align:justify\">After a violent 9-month liberation battle and the sacrifices of more than 3 million Bangladeshi patriots, the country has gained freedom and independence.</p>\r\n\r\n<p style=\"text-align:justify\">On December 16, 1971, more than 200 years of historical oppression for East Pakistanis came to an end. It was the end of a dark history spanning hundreds of years, the end of a hellish lifestyle, and the end of the Pakistani Army&#39;s daily torturing of East Pakistanis (Bengalis living in East Pakistan) and arrived independence being its sun of liberty into Bengalis lives. Pakistanis surrendered on December 16th, signed an agreement paper, and eventually left Bangladesh for good, recognizing Bangladesh&#39;s sovereignty. The country started to stand on its own and grow as a developing country in the world day by day. After 51 years of these developing journeys, Bangladesh has almost become a digitalized country having 74.68 percent of the global literacy rate at present, according to the macrotrends data.</p>\r\n\r\n<p style=\"text-align:justify\">This long 51 years journey wasn&rsquo;t easy at all regarding the reorganization of the economic condition of Bangladesh. There lies untold molded ups and downs to reach today&rsquo;s state. The then West Pakistanis had almost broken Bengalis&rsquo; overall financial and structural condition from in and out.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">An awful history that started from:</h3>\r\n\r\n<p style=\"text-align:justify\">Bangladesh had just recovered from an extremely low and negative growth rate. Bangladesh&#39;s GDP growth rate in FY 1972-73 was merely 2.5 percent. This is due to the fact that the GDP at the time was barely 4 thousand 294 crores. The first five-year plan following independence established a target of 5% growth to overcome this negative and downward growth rate. The population rate has grown to unfathomable proportions. A larger part of the people who had migrated to India during the battle eventually returned to Bangladesh. Bangladesh did not have enough intellectuals at the time to take on the mission of shaping the country into a successful nation. To gain a place on the global map, it had to sacrifice millions of lives and lose Bengali scholars&rsquo; worth of hundreds of years of assets. Bengali&rsquo;s bright history of successive achievements got demolished and the country lingered behind for hundreds of years.</p>\r\n\r\n<p style=\"text-align:justify\">Bangladesh&#39;s economy was wrecked in no time as Pakistanis left no stone unturned in their efforts to destroy Bangladesh from the inside out. The transportation system was paralyzed as a result of the Pakistanis&#39; attempts to destroy it. Due to Bangladesh&#39;s geographical location, no commerce was feasible without transportation, the country&#39;s prominent exportation sector&mdash;jute&mdash;was no longer able to trade, and the foreign trade sector was blunted. Without exports, there will be no foreign monetary assistance, no inbound remittances, and no national growth. The financial situation had deteriorated to the point that any form of agricultural expansion was difficult to design and implement. Agriculture&#39;s output fell down, and the government was unable to modernize the manufacturing and service industries&#39; infrastructure. Because of the damaged national infrastructure, the country was forced to remain underdeveloped for a long time, and the initial status of the economy remained worse for a few years following the liberation struggle.</p>\r\n\r\n<p style=\"text-align:justify\">Due to the country&#39;s destroyed economic structure, the then US Secretary of State Henry Kissinger subsequently labeled it a &quot;Bottomless Basket&quot; because it was also endowed with a relatively limited mineral resource (excluding natural gas) in comparison to its bigger population rate. Commercial exploitation brought additional curses with it as it moved from domestic to foreign trade. The supply chain was disrupted, affecting the fundamentals of industries and commerce, resulting in an increase in inflation and an excessive imbalance in economic supply and demand forces. The laborers&rsquo; availability finally resulted in material shortages. The country had a difficult time adapting to residential management. Engineers, physicians, teachers, professors, and many more intellectuals were mercilessly massacred by Pakistanis, leaving the nation in a low and impoverished state. In addition, the Bengalis who had migrated had to deal with not having a place to live.</p>\r\n\r\n<p style=\"text-align:justify\">Various sectors of the economy almost stopped contributing anymore. Shaken infrastructure badly affected its profitable segments. Agricultural &amp; industrial sectors might have been starting to shape after 1971, having a very slow and steady growth of the service sector compared with others, the most destroyed sector was the banking &amp; monetary which was totally unreliable and displaced. It took Bangladesh quite a long time to set up a stable banking system.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Endurance of the distress continues:</h3>\r\n\r\n<p style=\"text-align:justify\">In the middle of the suffering and crisis, the East Pakistanis&#39; history was once again crushed. The 1970 Bhola Cyclone had just passed through the continent, making it the scariest tropical cyclone on record and one of the world&#39;s worst catastrophes. In the aftermath of the storm, an estimated 500,000 people died, largely as a result of the coastal flooding that swamped much of the Ganges Delta&#39;s low-lying islands. East Pakistanis were only trying to dodge the tortures when calamity hit, worsening their miseries for a longer period of time, compounding the distressing level of the economy of Bangladesh (the then East Pakistan).</p>\r\n\r\n<p style=\"text-align:justify\">Bangladesh, although being a part of the Indian subcontinent, previously boasted a huge array of economic resources that were very important in the global economy. Pakistanis attempted to snatch its glorifying assets and were brutally successful in shattering the country&#39;s foundation&mdash;this was the driving force behind the people of Bangladesh&#39;s desire to free their country from those enemies, and Bangladesh eventually ended up as a resourceless country wearing the crown of triumph. They struggled to protect their mother language and gave their lives in order to give birth to Bangladesh, an independent nation. From a crippled economy to one of the most remarkable economies in the whole world, Bengalis&rsquo; journey towards a glorious history wasn&rsquo;t a piece of cake at all. In terms of the global economy, it is now one of the most profound countries on earth. It is now regarded as a developing economic country.</p>\r\n\r\n<p style=\"text-align:justify\">In 2021, it has become the world&#39;s 33rd largest economy in terms of nominal GDP, with RMG manufacturing contributing 84 percent of Bangladesh&#39;s exports. In the 50 years since independence, Bangladesh&#39;s GDP has grown 281 times and its per capita income has climbed about 301 times. Bangladesh&#39;s GDP in FY 2020-21 is 416 billion, and per capita income is 2,591. (according to BBS). Despite the fact that the pandemic of 2020 has eroded the country&#39;s economic development, consistent and steady improvement in other areas of the economy has helped the country to prosper to a large extent.</p>', NULL, 'a462517714fa6e6650c28e06357ed7b6.png', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2023-01-01 04:51:15', '2023-01-01 07:33:12');
INSERT INTO `posts` (`id`, `title_en`, `title_bn`, `slug`, `category`, `shortdes_en`, `shortdes_bn`, `description_en`, `description_bn`, `images_en`, `images_bn`, `seo_title`, `seo_meta`, `alt_en`, `alt_bn`, `status`, `editable`, `posted_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(9, 'Fintech: A Prominent Revamp in Bangladesh', NULL, 'fintech-a-prominent-revamp-in-bangladesh', 2, 'Fintech is a term that has recently become a buzzword throughout the world. Everyone is now adopting modern financial services', NULL, '<p style=\"text-align:justify\"><img alt=\"\" src=\"data:image/png;base64,\" style=\"max-width:100%\" /></p>\r\n\r\n<p style=\"text-align:justify\">Fintech is a term that has recently become a buzzword throughout the world. Everyone is now adopting modern financial services to remain at the forefront of today&#39;s advanced simulated sphere, from SMEs to large corporations. Innovators with creative mindsets are stepping up to bring innovation to the frontline of the most significant challenge for the company and corporate success. Consumers from peripheral regions aren&#39;t trailing behind when it comes to adopting newer MFS (Mobile Financial Service) since they are open to new modifications in deferred fintech systems.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">FIN &amp; TECH Talks</h3>\r\n\r\n<p style=\"text-align:justify\">Fintech was originally only associated with reformed and well-known institutions and industries. However, because the era was not frozen in any way, the concepts&#39; restraints were going to come to an end as well. Fintech is now expanding its horizons and representing a variety of industries, including education, banking systems, integrated financial services, and so on, as well as harmonizing its business modules through customer-centric approaches.</p>\r\n\r\n<p style=\"text-align:justify\">A fintech is a cutting-edge approach to financial services that integrates technology and science to bridge the gap between traditional payment methods and consumer experience, according to the popular view. It refers to sophisticated software and technology that businesses and organizations use to enhance automated financial services. As a consequence of the adoption of fintech principles in financial operations, financial systems have become quicker, more cost-effective, and less time-consuming, with fewer opportunities for fraudulent cash disposal.</p>\r\n\r\n<p style=\"text-align:justify\">Fintech businesses in Bangladesh are fast-growing in a short period, and some are dominating the sector due to their diverse business models and strategic planning aspects. And some are still emerging themselves bringing innovative business ideas. Fintech has cemented its place in sectors of life that have made everyone&#39;s life simpler and more efficient, ranging from users&#39; daily bill payments to mobile top-up, mobile banking, and merchant interactions.</p>\r\n\r\n<h3 style=\"color:#212529; font-style:normal; text-align:start\">Easy Payment System-EPS: In the Marathon of Digitalization</h3>\r\n\r\n<p style=\"text-align:justify\">Among all the fledgling financial technologies in Bangladesh, one of the fintech technologies which is about to emerge to break the ground in terms of mobile financial providers is Easy Payment System (EPS). EPS is an innovative mobile financial service that promises to simplify customers&#39; payment methods and assist them in resolving key technological concerns for new or previous users. This fintech technology has already been approved by Bangladesh Bank and aims to start a new revolution and seeks to usher in a new age by providing a wide range of services such as balance transfers, merchant payments, mobile pop-ups, corporate services, and more. It aspires to be one of Bangladesh&#39;s most famous MFS in terms of fintech by combining the most popular features into a single app.</p>\r\n\r\n<p style=\"text-align:justify\">As technology progresses, fintech in Bangladesh is becoming more sustainable. In a short amount of time, fintech is expected to dominate the financial industries In Bangladesh. Fintechs such as EPS are predominantly focused on reducing financial inefficiencies and a lifestyle that boosts customers&rsquo; happiness by delivering a hassle-free and fast-paced financial experience.</p>', NULL, '18a6adbe2f9c87b59e0f0d89f38a7a88.png', '', NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2023-01-01 04:55:42', '2023-01-01 07:36:09');

