(1, 'OSSL received PSO license from Bangladesh Bank', 'ossl-received-pso-license-from-bangladesh-bank', 'English', 2, 'Bangladesh Bank granted the Payment System Operator (PSO) license to technology solution provider Optimum Solution and Services Ltd. (OSSL) ...', '<p>Bangladesh Bank granted the Payment System Operator (PSO) license to technology solution provider Optimum Solution and Services Ltd. (OSSL). Using the Easy Payment System (EPS) brand, this license enables OSSL to function as a PSO.</p>\r\n\r\n<p>On Tuesday, August 23, 2022, a circular regarding the license was issued by the Payment Systems Department (PSD) of Bangladesh Bank. The issued circular has been sent to the Managing Directors/Chief Executives of all Scheduled Banks, Mobile Financial Services Providers, Payment System Operators and Payment Service Providers in the country.</p>\r\n\r\n<p>The Business Standard, a top English newspaper in Bangladesh, reported on the EPS license.</p>\r\n\r\n<hr />\r\n<h4>&ldquo;Optimum gets payment gateway licence</h4>\r\n\r\n<p>&mdash; By The Business Standard</p>\r\n\r\n<h4>Tech service provider Optimum Solution &amp; Services Ltd received the Payment System Operator (PSO) license from the Bangladesh Bank.</h4>\r\n\r\n<p>From now on, the company will be able to serve as a payment gateway for various business entities.</p>\r\n\r\n<p>In a circular on Tuesday (23 August), the Payment System Department of the central bank informed all banks, mobile financial services providers, payment system operators and payment service providers of the approval.</p>\r\n\r\n<p>The central bank issued the license to Optimum solution &amp; Services as the brand name of Easy Payment System (EPS) in line with the Bangladesh Payment and Settlement Systems Regulations-2014.</p>\r\n\r\n<p>Optimum Solution and Services is an information solution developer that provides services and solutions and provides support to industries like IT, agriculture, telecommunications and project management.</p>\r\n\r\n<p>PSO company operates a settlement system for payment activities among participants of which the principal participant must be a scheduled bank or financial institution such as a payment gateway, payment aggregator etc.</p>\r\n\r\n<p>Earlier, the central bank issued payment service provider (PSP) and payment system operator (PSO) licences to ten more companies.&rdquo;</p>', 'The Business Standard', '23 Aug 2022', '2a3533c00cc6f8c6a5c63696667bc27a.png', 'https://www.tbsnews.net/tech/optimum-gets-payment-gateway-licence-482534', 'bd3090b2811518ef98db428acfdfad22.png', 'Easy Payment System', 'asdf', 'dfghjm', 'fghjkl', 1, 1, 1, 1, '2023-01-01 11:34:22', '2023-01-01 11:37:07'),
(2, 'OSSL received Payment System Operator (PSO) license from Bangladesh Bank', 'ossl-received-payment-system-operator-pso-license-from-bangladesh-bank', 'English', 2, 'Technology solution-providing company Optimum Solution and Services Ltd. (OSSL) received the Payment System Operator (PSO) license from Bangladesh Bank on 23 August...', '<p style=\"text-align:left\">Technology solution-providing company Optimum Solution and Services Ltd. (OSSL) received the Payment System Operator (PSO) license from Bangladesh Bank on 23 August 2022. This license allows OSSL to operate as a PSO under the brand Easy Payment System (EPS).</p>\r\n\r\n<p style=\"text-align:left\">With this authorization, EPS is able to provide financial transaction services to individuals and businesses. EPS promises to unveil new horizons to the digital financial ecosystem. Thereupon, the theme of EPS always remained&nbsp;<strong>- Easy Solution for All Transactions</strong>.</p>\r\n\r\n<p style=\"text-align:left\">News on EPS license was published by The Daily Star, a leading English newspaper in Bangladesh.</p>\r\n\r\n<hr />\r\n<h4 style=\"margin-left:0; margin-right:0; text-align:start\">Optimum Solution gets licence to run payment system</h4>\r\n\r\n<p style=\"text-align:left\">&mdash; By The Daily Star</p>\r\n\r\n<h4 style=\"margin-left:0; margin-right:0; text-align:start\">OSSL received Payment System Operator (PSO) license from Bangladesh Bank</h4>\r\n\r\n<p style=\"text-align:left\">Optimum Solution &amp; Services Ltd has received a licence from the Bangladesh Bank to operate as a payment system operator.</p>\r\n\r\n<p style=\"text-align:left\">The company will run the operation under the brand name of Easy Payment System (EPS), according to a notice of the central bank yesterday.</p>\r\n\r\n<p style=\"text-align:left\">Optimum Solution is an information solution developer that provides services and solutions and supports industries such as IT, agriculture, telecommunications, manufacturing, and health, said its website</p>\r\n\r\n<p style=\"text-align:left\">PSOs operate a settlement system for payment activities between or among participants of which the principal participant must be a scheduled bank or financial institution. They are also known as payment gateways and payment aggregators.</p>\r\n\r\n<p style=\"text-align:left\">Authorised PSOs in Bangladesh include IT Consultants Ltd, Software Shop Ltd, ShurjoMukhi Ltd, Portonics Ltd, Walletmix Ltd, and Soft Tech Innovation Ltd.&rdquo;</p>', 'The Daily Star', '24 Aug 2022', 'a9b5e37d2f5baa698110913e32ad890c.png', 'https://www.thedailystar.net/business/organisation-news/news/optimum-solution-gets-licence-run-payment-system-3101666', 'e23971818651be4da67d2422472cfbe7.png', NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2023-01-01 11:46:11', '2023-01-01 11:49:16'),
(3, 'Bangladesh Bank granted Payment System Operator (PSO) license to Easy Payment System (EPS)', 'bangladesh-bank-granted-payment-system-operator-pso-license-to-easy-payment-system-eps', 'English', 2, 'Easy Payment System (EPS) is an innovative payment solution permitted by Bangladesh Bank as a PSO ...', '<p style=\"text-align:left\">Easy Payment System (EPS) is an innovative payment solution permitted by Bangladesh Bank as a Payment System Operator (PSO). Developed by a global technology solution provider Optimum Solution and Services Ltd. (OSSL), EPS aims to provide Fintech solutions for all financial Institutions.</p>\r\n\r\n<p style=\"text-align:left\">The ecosystem of the digital financial promises to be expanded by EPS. The theme of EPS was then and has always been an Easy Solution for All Transactions.</p>\r\n\r\n<p style=\"text-align:left\">News on EPS license was published by Bangladesh Post, a prominent English online portal in Bangladesh.</p>\r\n\r\n<hr />\r\n<h4 style=\"margin-left:0; margin-right:0; text-align:start\">&ldquo;Optimum Solution gets PSO licence from BB</h4>\r\n\r\n<p style=\"text-align:left\">&mdash; By Bangladesh Post</p>\r\n\r\n<h4 style=\"margin-left:0; margin-right:0; text-align:start\">Bangladesh Bank granted Payment System Operator (PSO) license to Easy Payment System (EPS)</h4>\r\n\r\n<p style=\"text-align:left\">Technology solution providing company Optimum Solution and Services Ltd. (OSSL) received the Payment System Operator (PSO) license from Bangladesh Bank on Tuesday</p>\r\n\r\n<p style=\"text-align:left\">With this, OSSL will be able to operate as a PSO under the brand name Easy Payment System (EPS).</p>\r\n\r\n<p style=\"text-align:left\">A circular regarding the license was issued by the Payment Systems Department (PSD) of Bangladesh Bank. The issued circular has been sent to the Managing Directors/Chief Executives of all Scheduled Banks, Mobile Financial Services Providers, Payment System Operators and Payment Service Providers in the country.</p>\r\n\r\n<p style=\"text-align:left\">The circular states that, &ldquo;According to the &lsquo;Bangladesh Payment and Settlement Systems Regulation&ndash;2014&rsquo; issued under Section 7(A) (E) of Bangladesh Bank Order 1972, OSSL has been given the license as a PSO to run its operations within under the brand name of Easy Payment System (EPS)&rdquo;.</p>\r\n\r\n<p style=\"text-align:left\">PSD of Bangladesh Bank has so far granted licenses to a total of seven institutions as PSO. EPS is one of them. With this authorization, EPS is able to provide financial transaction services to individuals and businesses. EPS promises to unveil new horizons to the digital financial ecosystem. The theme of EPS is &lsquo;Easy Solution for All Transactions&rsquo;.&rdquo;</p>', 'Business Desk', '25 Aug 2022', '9f238b99c141a78a40d35bc84cd8a4ff.png', 'https://www.bangladeshpost.net/posts/optimum-solution-gets-pso-licence-from-bb-93127', '432a03b0f0a8f0659364b64e1ed69523.png', NULL, NULL, NULL, NULL, 1, 1, 1, 1, '2023-01-01 11:48:15', '2023-01-01 12:01:50');

